snippet.textDisplay:
@Zona Sobrenatural e quando foi que eu votei nele? '-'
De minha lembrança, só votei no PT uma única vez na vida e foi para prefeito na minha cidade. 

Só pq uma pessoa vê falhas no governo atual não significa que ela tenha paixão por PT, migo! o mundo não tem só duas cores...

